import React from 'react';

class Header extends React.Component {

    constructor() {
        super();
        this.state = {
            bookstoreName : "Red Books"
        }
    }

    f =() =>{
        this.setState({
            clicked : false
        })
    }

    render () {
        return (
        <div className="row header" >
        <button className="btn btn success" ><h1>{this.state.bookstoreName}</h1></button>
        </div>
        );
    }

}

export default Header;
